import { Link } from 'react-router-dom';
import {Nav,NavDropdown,Dropdown,DropdownButton, Button} from 'react-bootstrap'
import { useNavigate } from "react-router-dom";
import './Navbar1.css';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';
function Navbaradmin(props) {

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light navbar-custom">
  <div className="container-fluid">
    <a className="navbar-brand ">
    
       Employee Management System
        </a>
        </div>
    
<NavbarCollapse id="basic-navbar-nav">
    <Nav className="ml-auto">
    </Nav>
    </NavbarCollapse>
    <Nav className="ml-auto">
    <Link to="/" ><Button style={{backgroundColor:' ',color:'black'}}className='custom-button'>Home</Button></Link>
    </Nav>
 

    <DropdownButton title="Add" style={{color:'black'}} className="custom-dropdown-button">
  
{/* <NavDropdown.Divider></NavDropdown.Divider> */}
<Dropdown.Item >
  <Link to="/Employee">
 Add Employee
  </Link>
  </Dropdown.Item>
  <Dropdown.Item >
  <Link to="/Manager">
 Add Manager
  </Link>
  </Dropdown.Item>
  
{/* <NavDropdown.Divider></NavDropdown.Divider> */}
<Dropdown.Item href="/">
  
</Dropdown.Item>
    </DropdownButton>
   
   
              </nav>

    </div>
  );
}

export default Navbaradmin;
